import React from "react";
import "./style.css";

function Header() {
  return <div>
      <div className="head">해야 할 일</div>;
      <button
          className="backBtn"
          onClick={() => {
            navigate("/");
          }}
        >
          돌아가기
        </button>
  </div>

}

export default Header;
